import axios from "axios";
const URL = "/api/businesses";

export default {
    search: function () {
        return axios.get("/api/businesses")
    },
    update: function (id, rating) {
        console.log(rating);
        return axios.put(`${URL}/${id}`, {rating});
    }
}
